import {makeStyles} from '@material-ui/core/styles'

const useStyles = makeStyles(theme => ({
  bar: {
    height: theme.spacing(3),
    width: theme.spacing(15),
    background: "silver",
  }
}))

function Skills() {
  return (
    <div>
      <div>one</div>
      <div>two</div>
      <div>three</div>
      <div>four</div>
    </div>
  )
}

export default Skills
